INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "あたしだって\nやるときはやるよ！", 1, 0.0, 1, 0.0, 0.0, 24, 0, 24001, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 0.0, 1, 0.0, 0.0, 24, 1, 24002, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "終わった終わった\n一人でもなんとか\nなるもんだね", 1, 0.0, 1, 0.0, 0.0, 24, 2, 24003, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "やったね！\nこれでようやく\nサボれるよ…", 2, 0.0, 2, 0.0, 0.0, 24, 3, 24004, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, 0.0, 1, 0.0, 0.0, 24, 4, 24005, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, 0.0, 2, 0.0, 0.0, 24, 5, 24006, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "あたしも意外と\nやるもんでしょ？", 2, 0.0, 2, 0.0, 0.0, 24, 6, 24007, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, 0.0, 4, 0.0, 0.0, 24, 7, 24008, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, 0.0, 4, 0.0, 0.0, 24, 8, 24009, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "まじめに\nやったんだけどな…\n悔しいな～", 4, 0.0, 4, 0.0, 0.0, 24, 9, 24010, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "やられた…\nねずみって意外と\nてごわいね", 4, 0.0, 4, 0.0, 0.0, 24, 10, 24011, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, 0.0, 4, 0.0, 0.0, 24, 11, 24012, 102601, 10040, "2020/04/30 12:00:00", "リン");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2030/12/17 14:59:59", "疲れた…\nけど、次こそは\n守り抜くよ…", 4, 0.0, 1, 0.0, 1.81, 24, 12, 24013, 102601, 10040, "2020/04/30 12:00:00", "リン");
